import logo from './logo.svg';
import { BrowserRouter, Routes, Route } from 'react-router-dom';
import './App.css';
import HomePage from "./components/homepage";
import Navbar from "./components/navbar"

function App() {
  return (
    <div className="App">
      <Navbar />
      <BrowserRouter>
        <Routes>
          <Route exact path="/" component={HomePage}></Route>
        </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
